import React from "react";

function Navbar() {
  return (
    <nav>
      <ul className="first-list">
        <li>Home</li>
        <li>Destination</li>
        <li>Near Me</li>
        <li>Events</li>
        <li>About Us</li>
        <li>Contact Us</li>
      </ul>
      <ul className="second-list">
        <li>Sign Up</li>
        <li>Sign In</li>
      </ul>
    </nav>
  );
}

export default Navbar;
